import React, { Component }  from 'react';
import netflix from './icons/netflix.png';
import amazon from './icons/amazon.png';
import hulu from './icons/hulu.png';
import hbo from './icons/hbo.png';

class ListItem extends Component
{
  render()
  {
    return (
      <div style={{
        display: 'flex',
        border: '2px solid black'
      }}>
        <img src={this.props.poster} width='120vh' height='171vh' />
        <div>
          <div style={{marginLeft: '0px'}}>Movie Title</div>
          <div style={{
            display: 'flex',
            justifyContent: 'space-between'
          }}>
            <a href='https://www.netflix.com'>
              <img src={netflix} width='32px' height='32px' style={{padding: '10px 10px 0px 10px'}} />
            </a>
            <a href='https://www.hulu.com'>
              <img src={hulu} width='32px' height='32px' style={{padding: '10px 10px 0px 0px'}} />
            </a>
            <a href='https://www.amazon.com'>
              <img src={amazon} width='32px' height='32px' style={{padding: '10px 10px 0px 0px'}} />
            </a>
            <a href='https://www.hbo.com'>
              <img src={hbo} width='32px' height='32px' style={{padding: '10px 10px 0px 0px'}} />
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default ListItem;
